import React from 'react';
import './ToDoStyle.css';

const ToDo = ({todo, handleToggle}) => {

    const handleClick = (e) => {
        e.preventDefault()
        handleToggle(e.currentTarget.id)
    }
   return (
       <div className={todo.complete ? "strike" : ""}>
           {todo.task}
       </div>
   );
};

export default ToDo;
